import Button from "../generic/Button";
import Screen from "../generic/Screen";

const Stopwatch = () => {
    return (
    <div>
        <Screen />
        <div className="grid-container">
            <Button text="Start"/>
            <Button text="Stop" />
        </div>
    </div>
    )
};

export default Stopwatch;
